import React from 'react';

class ImageList extends React.Component {
    render() {
        let { filterResult } = this.props;

        let images = null;
        if (!!filterResult) {
            images = filterResult.map((image) => (
                <li key={image.id} className="textImage">
                    <p id="pcity">
                        {image.address.city}, {image.address.country}
                    </p>
                    <p id="paddress">
                        {image.address.line1}
                        {image.address.line2 ? image.address.line1 : ''}
                    </p>
                    <img src={image.imageUrl}></img>
                </li>
            ));
        }
        return (
            <div id="filterResult">
                <ul>
                    {images}
                </ul>
            </div>
        );
    }
}

export { ImageList }
